B":172.453125,"D":484.8125,"C":105.4,"a":{"A":[{"A?":"A","A":"Pengantar \\n"}],"B":[{"A?":"A","A":{"font-size":{"B":"88.0"},"font-family":{"B":"YAFcfr0ZwUA,0"},"color":{"B":"#490909"},"font-weight":{"B":"bold"},"text-align":{"B":"center"},"font-style":{"B":"italic"}}},{"A?":"B","A":11},{"A?":"A","A":{"font-size":{},"font-family":{},"color":{},"font-weight":{},"text-align":{},"font-style":{}}}]},"b":{"A":[11]},"d":"A","g":false,"h":"B"},{"A?":"K","A":293.6204075000001,"B":73.05305197258355,"D":757.300488121577,"C":535.3880125,"a":{"A":[{"A?":"A","A":"Banjarejo  sebuah kelurahan yang terletak di wilayah Kecamatan Taman, Kota Madiun, tepatnya di sebelah selatan kota tersebut. Kelurahan ini dikenal dengan kekayaan berbagai wisata Usaha Mikro, Kecil, dan Menangah (UMKM) yang dimilikinya, terutama kuliner. Beberapa di antaranya menjadi ikon utama Banjarejo. Madungmongso Wahyu Tumurun salah satunya, kuliner yang menjadi ikon dari Kelurahan Banjarejo  merupakan UMKM tertua di Kota Madiun. Selain itu, untuk membantu meningkatkan perekonomian terdapat Lapak Banjarejo yang menyajikan beragam makanan khas Madiun mulai dari nasi pecel hingga dawet jenang campur. Ikon kuliner selanjutnya adalah salah satu tempat makan legendaris dengan nuansa tradisional di Madiun, yakni Ayam Panggang Banjarejo dengan menu unggulan Ayam Panggang Bumbu Rujak. Tidak hanya itu, kawasan industri tahu  juga menjadi salah satu daya tarik utama di Banjarejo. \\n\\n"}],"B":[{"A?":"A","A":{"font-family":{"B":"YAFcfr0ZwUA,0"},"text-align":{"B":"justify"},"color":{"B":"#490909"},"font-size":{"B":"22.6667"},"leading":{"B":"1500.0"},"tracking":{"B":"12.0"}}},{"A?":"B","A":890},{"A?":"A","A":{"leading":{},"tracking":{}}},{"A?":"B","A":1},{"A?":"A","A":{"font-size":{},"text-align":{},"color":{},"font-family":{}}}]},"b":{"A":[63,63,60,61,61,55,61,56,54,57,64,61,56,62,56,1]},"d":"A","g":false,"h":"A"},{"A?":"K","A":854.8633202932133,"B":73.05305197258349,"D":757.300488121577,"C":401.19999,"a":{"A":[{"A?":"A","A":"Usaha Mikro, Kecil, dan Menengah (UMKM) memiliki peran penting dalam perekonomian nasional, menjadi ikon dari dinamika ekonomi yang bergerak maju. Di balik kesuksesan setiap UMKM, terdapat usahawan dan usahawati yang bersemangat, inovatif, dan berdedikasi dalam mengembangkan usaha mereka. Melalui semangat kewirausahaan yang tinggi, mereka tidak hanya menciptakan lapangan kerja tetapi juga mendorong pertumbuhan ekonomi lokal dan nasional.   Mereka terus berupaya meningkatkan daya saing dan kualitas produk mereka, sehingga mampu bersaing di pasar global, serta memberikan kontribusi signifikan dalam memperkuat ekonomi bangsa.\\n"}],"B":[{"A?":"A","A":{"text-align":{"B":"justify"},"color":{"B":"#490909"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6667"},"leading":{"B":"1500.0"},"tracking":{"B":"12.0"}}},{"A?":"B","A":631},{"A?":"A","A":{"text-align":{},"color":{},"font-family":{},"font-size":{},"leading":{},"tracking":{}}}]},"b":{"A":[55,55,57,50,59,58,58,59,59,55,58,8]},"d":"A","g":false,"h":"A"},{"A?":"K","A":1315.5095827932132,"B":73.0530519725836,"D":757.300488121577,"C":435.25077125,"a":{"A":[{"A?":"A","A":"Buku ini mengungkap banyak inspirasi yang berharga dari para pelaku UMKM. Oleh karena itu, buku dengan judul Warisan Rasa Banjarejo dibuat sebagai penghargaan dan dokumentasi atas perjalanan singkat berbagai UMKM kuliner di Kelurahan Banjarejo.  Buku ini juga berfungsi sebagai panduan bagi pembaca dan Wisatawan yang ingin menjelajahi kuliner ikonik di Kelurahan Banjarejo. Dengan buku ini, kami berharap dapat mengajak lebih banyak orang untuk merasakan kekayaan rasa dan cerita yang ditawarkan oleh Kelurahan Banjarejo.\\n\\n\\n\\n\\n"}],"B":[{"A?":"A","A":{"color":{"B":"#490909"},"tracking":{"B":"12.0"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6667"},"text-align":{"B":"justify"},"leading":{"B":"1500.0"}}},{"A?":"B","A":109},{"A?":"A","A":{"font-style":{"B":"italic"}}},{"A?":"B","A":22},{"A?":"A","A":{"font-style":{}}},{"A?":"B","A":396},{"A?":"A","A":{"color":{},"tracking":{},"font-family":{},"font-size":{},"text-align":{},"leading":{}}}]},"b":{"A":[61,61,58,66,57,61,63,59,37,1,1,1,1]},"d":"A","g":false,"h":"A"},{"A?":"K","A":2194.1134727376375,"B":-95.82737345717987,"D":682.5828478723166,"C":39.33334,"a":{"A":[{"A?":"A","A":"Warisan Rasa Banjarejo | 4\\n"}],"B":[{"A?":"A","A":{"color":{"B":"#490909"},"text-align":{"B":"center"},"font-size":{"B":"33.3333"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-style":{"B":"italic"}}},{"A?":"B","A":27},{"A?":"A","A":{"color":{},"text-align":{},"font-size":{},"font-family":{},"font-style":{}}}]},"b":{"A":[27]},"d":"A","g":false,"h":"A"}]},{"A?":"i","a":"PBhHPYVzvr5lQDpQ","D":{"C":"#ffffff"},"E":[{"A?":"I","A":-28.1688035814675,"B":-3.2593160990923025,"D":1708.6266026861006,"C":2278.1688035814673,"F":0.59,"a":{"B":{"A":{"A":"MAFp8N0Xnqc","B":1},"B":{"D":1708.6266026861006,"C":2278.1688035814673}}}},{"A?":"I","A":1260.759527789227,"B":721.5023403744548,"D":730.0706889987971,"C":1049.9583106291252,"a":{"B":{"A":{"A":"MAGR0RK4Op0","B":1},"I":{"A":"MAGR0ZsOmn4","B":1},"B":{"B":-423.86775774926105,"D":1577.8062044973192,"C":1049.9583106291252}}}},{"A?":"K","A":54.92928641710614,"B":180.48312466245102,"D":1049.033750675098,"C":48.0,"a":{"A":[{"A?":"A","A":"Madumongso dan Sambel Pecel Wahyu Tumurun \\n"}],"B":[{"A?":"A","A":{"font-size":{"B":"40.0"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-style":{"B":"italic"},"text-align":{"B":"center"},"color":{"B":"#490909"},"font-weight":{"B":"bold"}}},{"A?":"B","A":43},{"A?":"A","A":{"font-size":{},"font-family":{},"font-style":{},"text-align":{},"color":{},"font-weight":{}}}]},"b":{"A":[43]},"d":"A","g":false,"h":"A"},{"A?":"K","A":686.6161515639615,"B":15.826642720798418,"D":646.3603640750858,"C":1455.370733300102,"a":{"A":[{"A?":"A","A":"\\nMadumongso dan sambel pecel Wahyu Tumurun merupakan UMKM tertua di kota Madiun. Kuliner yang telah berdiri sejak 1995 ini menjadi salah satu ikon kebanggaan kota Madiun.latar belakang pendirian usahanya adalah karena keinginannya untuk memenuhi kebutuhan ekonominya dalam menghidupi ketiga anaknya. \\n\\n\\nMeskipun nama brand kuliner ini adalah ‘tumurun’, usahanya ini berasal dari resep yang beliau buat sendiri, tidak turun-temurun dari keluarganya. \\n\\nSebagai kuliner yang ikonik, Wahyu Tumurun mendapatkan kepercayaan dari Pemerintahan Kota Madiun. Pemberian nama merek dagang pun berasal dari pemerintah Kota Madiun. Banyak orang-orang penting dari pemerintahan yang menjadi bagian dari pelanggan setia kuliner kondang ini. Bahkan urusan perizinan dan hak paten usahanya Mbah Danuk berkata sangat dimudahkan dan dibantu oleh pemerintahan Kota Madiun.  \\n\\nTidak ada resep rahasia yang di gunakan, Kuncinya dalam menjaga produk ini adalah menjaga dan meningkatkan cita rasa serta kualitas produknya.\\n\\n\\n\\n"}],"B":[{"A?":"A","A":{"font-weight":{"B":"bold"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"24.8096"},"leading":{"B":"1500.0"},"text-align":{"B":"justify"},"tracking":{"B":"12.0"},"color":{"B":"#490909"}}},{"A?":"B","A":169},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":133},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":14},{"A?":"A","A":{"font-style":{"B":"italic"}}},{"A?":"B","A":6},{"A?":"A","A":{"font-style":{}}},{"A?":"B","A":20},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":7},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":61},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":40},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":29},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":13},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":56},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":68},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":238},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":141},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":2},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":3},{"A?":"A","A":{"font-weight":{},"font-family":{},"font-size":{},"leading":{},"text-align":{},"tracking":{},"color":{}}}]},"b":{"A":[1,34,38,41,33,38,33,38,35,10,1,1,39,43,38,27,1,43,29,41,41,40,43,44,40,41,41,1,41,41,41,20,1,1,1]},"d":"A","e":571.8308536846614,"f":1287.55712,"g":false,"h":"A"},{"A?":"K","A":110.92928641710614,"B":721.5023403744547,"D":619.0124429937281,"C":1123.1033627442416,"a":{"A":[{"A?":"A","A":"\\n\\nMadumongso yang sukses menggaet banyak konsumen ini terbuat dari bahan dasar berupa ketan hitam yang direndam selama sehari lalu dimasak hingga matang. Ketan hitam yang matang ini kemudian ditaburi ragi tape halus yang kemudian ditutup rapat-rapat di dalam panci selama kurang lebih tiga hari. Tape ketan hitam ini selanjutnya dimasukkan ke dalam wajan yang berisi santan, gula pasir, dan gula merah yang telah dipanaskan selama 30 menit. Proses pencampuran tape ketan hitam ini membutuhkan waktu kurang lebih empat jam. Setelah matang tape ketan hitam ini yang telah tercampur bahan-bahan lainnya ini menjadi madu mongso yang siap dikemas untuk disantap. Madumongso yang dibungkus dengan kertas minyak warna-warni bertahan paling lama satu bulan karena dibuat tanpa menggunakan pengawet. \\n\\nSementara itu, untuk proses pembuatan pecel dilakukan dengan mencampurkan kacang yang dioven, cabe rawit, cabe besar, garam, buah jeruk purut, buah asem, gula merah, dan gula putih menjadi satu dan merata sempurna. Bahan-bahan tersebut kemudian dimasukkan ke penggilingan sambel. Untuk mendapatkan cita rasa yang sempurna, setelah keluar dari penggilingan bahan-bahan tersebut diaduk lagi agar bumbunya merata. Sambel pecel ini tahan selama lima bulan. \\n\\n"}],"B":[{"A?":"A","A":{"color":{"B":"#490909"},"font-weight":{"B":"bold"},"font-size":{"B":"22.6667"},"font-family":{"B":"YAFcfr0ZwUA,0"},"text-align":{"B":"justify"},"leading":{"B":"1500.0"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-weight":{},"tracking":{"B":"12.0"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?" n mencicipi kuliner ikonik Madiun ini salah satunya pada Lapak Banjarejoku yang berada di Jalan Sedoro Nomor 17b. \\n\\nBu Katini (55) salah seorang penjual Nasi Pecel di Lapak Banjarejo telah menekuni UMKM kuliner ini kurang lebih enam tahun yang lalu sejak pertama kali Lapak Banjarejo didirikan. \\n\\nSelain nasi pecel, Bu Endang juga menjual variasi makanan lainnya seperti tahu telor, soto, dan nasi jotos. Bu Endang mengungkapkan jika menu andalan yang menonjol di lapaknya adalah nasi pecel dan soto. Penjualan paling ramai biasanya hari libur atau hari minggu. Tidak hanya melayani penjualan secara langsung, Bu Endang juga menerima pesanan.\\n\\n\\n\\n"}],"B":[{"A?":"A","A":{"font-weight":{"B":"bold"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"20.1371"},"leading":{"B":"1500.0"},"text-align":{"B":"justify"},"tracking":{"B":"12.0"},"color":{"B":"#490909"}}},{"A?":"B","A":144},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":138},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":12},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":57},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":112},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":349},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":2},{"A?":"A","A":{"font-weight":{},"font-family":{},"font-size":{},"leading":{},"text-align":{},"tracking":{},"color":{}}}]},"b":{"A":[2,1,53,57,57,55,52,6,1,57,55,56,12,1,58,60,49,54,56,51,18,1,1,1]},"d":"A","g":false,"h":"A"},{"A?":"K","A":954.39999,"B":754.4841219446262,"D":584.806138143003,"C":1284.8849478050568,"a":{"A":[{"A?":"A","A":" \\nBu Endang mengungkapkan jika sambal pecel menjadi keunikan utama dari nasi pecelnya. Ia mengungkapkan jika kacang yang ia gunakan untuk membuat sambal pecel adalah kacang tuban. Proses pembuatan sambel pecelnya juga berbeda dari yang lain, yakni dengan cara menyangrai kacangnya sendiri tanpa mengoven atau menggoreng dengan minyak. Kacang yang telah disangrai ditambah dengan cabai, buah asem, daun jeruk, garam "A":732.0983365916554,"B":39.18054674258627,"D":627.9006137662343,"C":1166.3512130659815,"a":{"A":[{"A?":"A","A":"\\nDi Lapak Banjarejo terdapat dawet jenang campur dan lontong sayur. Selama hampir empat tahun, Bu Siti (56) yang menjalankan usaha lontong sayur dan dawet  jenang di Lapak Banjarejoku. Usaha kuliner ini awalnya dirintis oleh anaknya yang saat itu belum memiliki pekerjaan. \\n\\nMenu makanan yang dijual oleh Bu Siti sangat beragam dan menggugah selera, termasuk lontong sayur, dawet jenang campur, tahu telor, tahu kecap, dan es buah. Berbeda dengan penjual dawet lainnya, Bu Siti berinovasi dengan tidak hanya menjual dawet, tetapi juga memadukannya dengan jenang, menciptakan kuliner unik yang memikat banyak pengunjung.  \\n\\nKini kuliner es dan dawet jenang campur Bu Siti tidak hanya dinikmati oleh warga Banjarejo, tetapi juga menarik perhatian banyak orang dari luar kelurahan. Penjualan biasanya meningkat tajam selama bulan puasa dengan permintaan yang bisa mencapai ratusan cup per hari. \\n\\nEs dan dawet jenang Bu Siti bahkan memiliki pelanggan setia dari luar Banjarejo, seperti Akademi Kereta Api Madiun, salah satu Politeknik Perkeretaapian Indonesia. Inovasi dan kualitas yang konsisten membuat usaha kuliner Bu Siti semakin dikenal luas dan dicintai banyak orang.\\n\\n"}],"B":[{"A?":"A","A":{"font-weight":{"B":"bold"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6667"},"leading":{"B":"1500.0"},"text-align":{"B":"justify"},"tracking":{"B":"12.0"},"color":{"B":"#490909"}}},{"A?":"B","A":4},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":427},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":190},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":257},{"A?":"A","A":{"font-style":{"B":"italic"}}},{"A?":"B","A":3},{"A?":"A","A":{"font-style":{}}},{"A?":"B","A":13},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":163},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":115},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":1},  diolah.\\nPengolahan Adonan\\nPisang yang telah dipilih kemudian dikupas dan dihaluskan. Setelah itu, pisang yang sudah dihaluskan dicampur dengan bahan-bahan lain seperti tepung terigu, telur, gula, dan sedikit susu untuk menambah cita rasa. Campuran ini diaduk hingga membentuk adonan yang kental dan homogen.\\nPembentukan dan Penggorengan\\nSetelah adonan siap, pisang dibentuk menjadi seperti steak, yaitu berbentuk pipih memanjang. Pisang yang telah dibentuk kemudian digoreng di atas wajan datar atau teflon dengan sedikit margarin atau mentega. Proses penggorengan dilakukan hingga kedua sisi pisang matang sempurna dan berwarna kecoklatan.\\nPenyajian\\nSteak pisang yang sudah matang kemudian disajikan dengan berbagai topping sesuai selera pelanggan. Beberapa pilihan topping yang umum digunakan antara lain cokelat leleh, keju parut, saus karamel, dan kacang. Topping ini menambah cita rasa manis dan memberikan tekstur yang berbeda saat dikonsumsi.\\nPenyimpanan untuk Frozen Food\\nSebagian produk juga dikemas dan dibekukan untuk dijadikan Frozen Food, yang bisa dinikmati di rumah kapan saja. Proses ini melibatkan pendinginan segera setelah steak pisang selesai digoreng untuk menjaga kesegarannya. Produk frozen ini kemudian dikemas dengan baik dan disimpan dalam freezer untuk menjaga kualitasnya.\\nDengan proses yang hati-hati dan menggunakan bahan-bahan berkualitas, Steak Pisang Banjarejo memastikan setiap produknya memiliki rasa yang lezat, tekstur yang nikmat, dan presentasi yang menarik.\\n\\n"}],"B":[{"A?":"A","A":{"text-align":{"B":"justify"},"leading":{"B":"1500.0"},"color":{"B":"#490909"},"tracking":{"B":"12.0"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6666"}}},{"A?":"B","A":236},{"A?":"A","A":{"text-align":{},"leading":{},"font-size":{},"font-family":{},"tracking":{}}},{"A?":"B","A":28},{"A?":"A","A":{"font-family":{"B":"YAFcfr0ZwUA,0"},"list-level":{"B":"1.0"},"leading":{"B":"1500.0"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"},"he . Apakah itu ulang tahun, pernikahan, acara kantor, atau pesta spesial lainnya, ibu Tri siap membantu mewujudkan kue impian Anda. Dengan variasi menu yang beragam dan kemasan yang menarik, setiap pesanan akan disesuaikan dengan tema dan kebutuhan acara Anda.\\nApa yang membuat Catering Kue Tri Wahyuningrum begitu istimewa adalah komitmen ibu Tri untuk memberikan pelayanan terbaik. Setiap pelanggan adalah bagian dari keluarga besar ibu Tri, dan ia selalu siap mendengarkan kebutuhan serta memberikan saran yang sesuai. Kesederhanaan dalam pelayanan dan kualitas produk membuat setiap pelanggan merasa dihargai dan puas.\\n\\n\\n"}],"B":[{"A?":"A","A":{"color":{"B":"#490909"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6666"},"leading":{"B":"1500.0"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":435},{"A?":"A","A":{"font-family":{},"font-size":{},"leading":{},"tracking":{},"text-align":{}}},{"A?":"B","A":391},{"A?":"A","A":{"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6666"},"leading":{"B":"1500.0"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-family":{},"font-size":{},"leading":{},"tracking":{},"text-align":{}}},{"A?":"B","A":384},{"A?":"A","A":{"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6666"},"leading":{"B":"1500.0"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-family":{},"font-size":{},"leading":{},"tracking":{},"text-align":{}}},{"A?":"B","A":361},{"A?":"A","A":{"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6666"},"leading":{"B":"1500.0"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":2},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":1},{"A?":"A","A":{"color":{},"font-family":{},"font-size":{},"leading":{},"tracking":{},"text-align":{},"font-weight":{}}}]},"b":{"A":[51,50,48,50,43,52,54,45,42,44,40,48,45,45,49,49,50,22,42,50,47,50,50,42,41,41,22,34,45,51,48,47,36,43,39 kepada para tamu, menjadikan setiap momen menjadi lebih berharga.\\nKeberhasilan Sambel Pecel dan Onde-Onde Ketawa 33 tidak hanya terletak pada rasa, tetapi juga pada pelayanan yang ramah dan hangat dari ibu Erahayu. Setiap pelanggan diperlakukan seperti keluarga, dengan perhatian dan dedikasi yang membuat pengalaman berbelanja menjadi menyenangkan.\\nJika Anda mencari cita rasa yang autentik dan memanjakan lidah, Sambel Pecel dan Onde-Onde Ketawa 33 adalah pilihan yang tepat. Kunjungi gerai ibu Erahayu dan nikmati kelezatan yang ditawarkan. Mari dukung usaha lokal ini dan nikmati setiap hidangan yang kaya rasa dan penuh kasih!\\n\\n"}],"B":[{"A?":"A","A":{"tracking":{"B":"12.0"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6666"},"text-align":{"B":"justify"},"leading":{"B":"1500.0"},"color":{"B":"#490909"}}},{"A?":"B","A":387},{"A?":"A","A":{"leading":{},"font-size":{},"font-family":{},"tracking":{},"text-align":{}}},{"A?":"B","A":283},{"A?":"A","A":{"leading":{"B":"1500.0"},"font-size":{"B":"22.6666"},"font-family":{"B":"YAFcfr0ZwUA,0"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":1},{"A?":"A","A":{"leading":{},"font-size":{},"font-family":{},"tracking":{},"text-align":{}}},{"A?":"B","A":281},{"A?":"A","A":{"leading":{"B":"1500.0"},"font-size":{"B":"22.6666"},"font-family":{"B":"YAFcfr0ZwUA,0"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-family":{},"font-size":{},"leading":{},"text-align":{},"tracking":{},"color":{},"font-weight":{}}}]},"b":{"A":[37,40,39,42,43,39,24,33,36,38,16,40,42,38,36,41,35,38,14,42,39,40,38,40,42,41,1]},"d":"A","e":504.7665199396241,"f":884.4109575,"g":false,"h":"A"},{"A?":"K","A":65.62614669163304,"B":34.406756748542534,"D":640.1549102819329,"C":103.9921875,"a":{"A":[{"A?":"A","A":"SAMBEL PECEL DAN ONDE-ONDE KETAWA 33\\n"}],"B":[{"A?":"A","A":{"text-transform":{"B":"uppercase"},"font-weight":{"B" restoran ini adalah ayam panggang, terdapat tiga ayam panggang yang ditonjolkan seperti ayam panggang bumbu rujak, ayam panggang madu, dan ayam panggang bawang. Dalam menikmati ayam panggang pengunjung dapat menikmati konsep lesehan, memberikan pengalaman makan yang unik dan autentik.\\n\\nRestoran ini menggabungkan sentuhan tradisional dalam era modern, menciptakan atmosfer yang memadukan kehangatan dan kenyamanan. Dekorasi tradisional yang kental memberikan nuansa nostalgia, sementara fasilitas modern memastikan kenyamanan pengunjung. Ayam Panggang Banjarejo tidak hanya menjadi tempat makan, tetapi juga destinasi yang mengundang kenangan dan keakraban, menjadikannya pilihan yang sempurna bagi siapa saja yang mencari pengalaman kuliner yang otentik dan memuaskan di Kelurahan Banjarejo. Ayam Panggang Banjarejo buka mulai dari pukul 08.00 hingga pukul 21.00 malam. \\n\\n\\n\\n"}],"B":[{"A?":"A","A":{"color":{"B":"#490909"},"tracking":{"B":"12.0"},"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"23.4302"},"text-align":{"B":"justify"},"leading":{"B":"1500.0"}}},{"A?":"B","A":493},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":235},{"A?":"A","A":{"font-weight":{}}},{"A?":"B","A":890},{"A?":"A","A":{"font-weight":{"B":"bold"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-weight":{},"font-family":{},"font-size":{},"leading":{},"text-align":{},"tracking":{},"color":{}}}]},"b":{"A":[1,108,115,27,1,110,111,19,1,104,104,28,1,106,98,95,1,102,109,106,107,107,55,1,1,1]},"d":"A","e":1413.875731382103,"f":902.97094,"g":false,"h":"A"},{"A?":"I","A":-28.1688035814675,"B":-3.2593160990923025,"D":1708.6266026861006,"C":2278.1688035814673,"F":0.59,"a":{"B":{"A":{"A":"MAFp8N0Xnqc","B":1},"B":{"D":1708.6266026861006,"C":2278.1688035814673}}}},{"A?":"K","A":41.666660000000064,"B":-83.64320675300769,"D":682.5828478723166,"C":39.3402865637207,"a":{"A":[{"A?":"A","A":"Warisan Rasa Banjarejo |  27\\n"}],"B":[{"A?":"A","A":{"font-size":{"B":"33.3333"},"font-family":{"B":"YAFcfr0ZwUA,  buku ini, kami berharap dapat menyampaikan betapa berharganya setiap kisah yang telah kami temui. Kami juga berharap bahwa buku ini dapat menjadi panduan dan inspirasi bagi pembaca untuk menjelajahi dan mendukung UMKM yang ada di Banjarejo.\\n\\nAkhirnya, kami ingin menyampaikan penghargaan yang mendalam kepada semua pelaku UMKM yang telah berbagi cerita dan inspirasi dengan kami. Semoga semangat dan dedikasi mereka terus menjadi pendorong bagi pertumbuhan ekonomi lokal dan menjadi contoh bagi generasi mendatang.  Tak lupa pula kami mengajak anda semua untuk merasakan dan menikmati setiap rasa dan cerita yang ditawarkan oleh Banjarejo.\\n"}],"B":[{"A?":"A","A":{"font-family":{"B":"YAFcfr0ZwUA,0"},"font-size":{"B":"22.6667"},"text-align":{"B":"justify"},"leading":{"B":"1500.0"},"color":{"B":"#490909"},"tracking":{"B":"12.0"}}},{"A?":"B","A":467},{"A?":"A","A":{"leading":{},"font-size":{},"tracking":{},"text-align":{}}},{"A?":"B","A":359},{"A?":"A","A":{"leading":{"B":"1500.0"},"font-size":{"B":"22.6667"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":2},{"A?":"A","A":{"leading":{},"font-size":{},"tracking":{},"text-align":{}}},{"A?":"B","A":5},{"A?":"A","A":{"font-style":{"B":"italic"}}},{"A?":"B","A":23},{"A?":"A","A":{"font-style":{}}},{"A?":"B","A":337},{"A?":"A","A":{"leading":{"B":"1500.0"},"font-size":{"B":"22.6667"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":2},{"A?":"A","A":{"leading":{},"font-size":{},"tracking":{},"text-align":{}}},{"A?":"B","A":397},{"A?":"A","A":{"leading":{"B":"1500.0"},"font-size":{"B":"22.6667"},"tracking":{"B":"12.0"},"text-align":{"B":"justify"}}},{"A?":"B","A":1},{"A?":"A","A":{"font-family":{},"font-size":{},"text-align":{},"leading":{},"color":{},"tracking":{}}}]},"b":{"A":[56,46,50,53,58,56,58,55,34,1,50,59,55,54,51,47,44,1,53,55,47,56,52,49,54,1,51,53,54,45,50,54,52,39]},"d":"A","g":false,"h":"A"},{"A?":"K","A":2186.2983265916555,"B":813.0880580809217,"D":682.5828478723166,"C":39.
